import React from 'react'
import './menu.css'
import imj from './logo1.jpg'

export default function Pgdetailslist(props){
    return(
        <>
        
        {/* <div class="card">
          <div class="pgname">{props.data.name}</div>
            <img src="C:\Users\sharaddu\Desktop\pg.jpeg"></img>
                <li>{props.data.name}</li>
                <p class="price">{props.data.rent_min}</p>
                <p class="price">{props.data.rent_max}</p>
                <p>wifi::{props.data.aminities.wifi}
                washing_machine::{props.data.aminities.washing_machine}
                   Cupboard::{props.data.aminities.cupboard}
                   Meal::{props.data.aminities.meal}
