                   zym::{props.data.aminities.gym}
                    {/* <room value={propsrooms}></room> 
                   </p>
            <div><button>Proceed</button></div>
        </div> */}

        <div className="list-container">
        <div className="place booked">
        <img src={imj}></img>
            <h3>{props.data.name}</h3>
            <div className="beds"><i class="fas fa-bed"></i>3 Beds Sharing</div>
            <div className="address">{props.data.address}</div>
            <div className="address">  {props.data.city}  {props.data.state}  {props.data.pincode}</div>
            <div className="price-label">
                Min Price
                <div className="price-lebel price"><i class="fas fa-rupee-sign"></i>{props.data.rent_min}</div>
            </div>
            <section >
                <div>
                <div><i class="fas fa-wifi"></i>Wifi Available</div>
                <div><i class="fas fa-couch"></i>Furnished</div>
                <div><i class="fas fa-utensils"></i>Meals Available</div>
            </div>
            {/* <i class="fas fa-dumbbell"></i>
            <i class="fas fa-swimming-pool"></i> */}
            <button>More Details</button>
            </section>
        </div></div>
        </>
    )
}

